Вторая часть беседы с основателем сообщества @vp-webdev, веб-разработчиком Евгением, известного нам под ником @tristamoff.

Первую часть можно прочитать [здесь](https://golos.blog/vox-populi/@vox-populi/soobshestva-intervyu-s-osnovatelem-vp-webdev)

___

@natasha: Женя, ты являешься делегатом?

@tristamoff: Нет, я не являюсь делегатом. 

@natasha: У тебя были мысли заявиться на роль делегата? 

@tristamoff: Да, они у меня были и до сих пор присутствуют. Я постоянно думаю, может, мне тоже стоит стать делегатом. Но что-то пока, может, я не созрел для этого. Потому что всё это дело надо поднимать, настраив

https://i.imgur.com/MGh9p2U.jpg



<div class="text-justify"> 


Сегодня мы делимся интереснейшей беседой с основателем сообщества @vp-webdev, веб-разработчиком Евгением, известного нам под ником @tristamoff.

___

@phoenix: Женя, привет! У нас есть традиция, которой мы не изменяем. Всем основателям, кого мы приглашаем в гости, я задаю два вопроса.  Как ты узнал о проекте? И как у тебя родилась идея о создании своего сообщества?

@tristamoff: Привет! О Голосе я узнал где-то полгода назад, даже больше, из ЖЖ блога доктора Степанова, с которым лично познакомился на ГолосФФесте. До этого я блогингом вообще никогда
